import { StyleSheet } from "react-native";


const estilo = StyleSheet.create({


    viewHeader:{
        flexDirection:"row",
        justifyContent:"space-between",
        alignItems:"center",
        marginTop:8,
        marginLeft:10
    },
    textHeader :{
        fontSize:25,
        color:"white",
        fontWeight:"bold",
        marginRight:75
    },
    headerImage :{
        width:100,
        height:50
    }



})

export default estilo;
